sub print_matrix_for_octave
{
   my $mat = shift;
   print "[";
   for( my $r = 0; $r < @$mat; $r++ )
   {
      for( my $c = 0; $c < @{$mat->[$r]}; $c++ )
      {
         print " $mat->[$r][$c]";
      }
      print ";"
   }
   print "]\n";
}
